import styles from "./Login.module.css";

import React from "react";

function Login() {
  return (
    <form className={styles["login-form"]}>
      <h2>Login</h2>
      <label>
        <span>email:</span>
        <input type="email" />
      </label>
      <label>
        <span>password:</span>
        <input type="password" />
      </label>
    </form>
  );
}

export default Login;
